import { Card } from "react-bootstrap";
import { useNavigate } from "react-router";

const Song = (props) => {
  const print = console.log(props.title);
  return (
    <Card>
      <h3>{print()}</h3>
      <img src={props.img} alt={props.song.title}></img>
      <h2>{props.song.title}</h2>
    </Card>
  );
};

export default Song;
